import './App.css';
import styled from 'styled-components';
import { Routes, Route, Link } from 'react-router-dom';
import ColorForm from './components/ColorForm';
function App() {


  return (
    <div className="App">
      <Title>
        Jordan Moore
      </Title>
      <Routes>
        <Route path='/' element={this} />
        <Route path='/color' element= {ColorForm}/>
      </Routes>
    </div>
  );
}

export default App;

const Title = styled.div`
  padding: 1em;
  display: flex;
  color: var(--light);
  font-size: 500%;
  letter-spacing: normal;
  transition: all 1s;

  :hover {
    letter-spacing: .05em;
  }
`;
